import React from 'react'
import ReactDOM from 'react-dom'
import './styles.css'
import Logo from './logo.png'



let college='SVECW'

function Welcome(){
    return(
        <div>
            <h1>Welcome to {college}</h1>
            <img src={Logo}/>
        </div>
    );
}
ReactDOM.render(
     
      <Welcome>
      </Welcome>,
       
    document.getElementById('root')
)
